import React from "react";
import Link from "next/link";
import axios from "axios";
import Header from "../../../components/Heading";
import Layout from "../../../components/Layout";

class edit extends React.Component {
  state = {
    user: {},
  };

  render() {
    return (
      <Layout>
        <Header />
        <section className="signup" id="signup">
          <form className="signup__form" action="" onSubmit={this.handleSubmit}>
            <label className="signup__label" htmlFor="email">
              email
              <input
                className="signup__input"
                type="email"
                id="email1"
                name="email"
                placeholder="eg: res@res.com"
                onChange={this.handleChange}
              />
            </label>
            <label className="signup__label" htmlFor="password">
              password
              <input
                className="signup__input"
                type="password"
                id="password1"
                name="password"
                placeholder="type password"
                onChange={this.handleChange}
              />
            </label>
            <label className="signup__label" htmlFor="password">
              confirm password
              <input
                className="signup__input"
                type="password"
                id="passwordConfirm"
                name="passwordConfirm"
                placeholder="confirm password"
                onChange={this.handleChange}
              />
            </label>

            <button className="signup__button">create account</button>

            <div className="signup__details">
              <Link href="/login">
                <a className="signup__register" id="backlogin">
                  login
                </a>
              </Link>
            </div>
          </form>
        </section>
      </Layout>
    );
  }
}

export default edit;
